import React from 'react';

import Input from '../../shared/components/FormElement/Input';
import { VALIDATOR_EMAIL ,VALIDATOR_MINLENGTH} from '../../shared/components/util/validators';
import Button from '../../shared/components/FormElement/Button';
import { useForm } from '../../shared/components/hooks/form-hook'

const Authenticate = () => {

    const [ formState, inputHandler ]= useForm({
        email: {
          value: '',
          isValid: false
        },
        password: {
          value: '',
          isValid: false
        },
    
      },false);

    return (
      <form>
        <Input
          id="email"
          element="input"
          type="text"
          lebel="Email"
          validator={VALIDATOR_EMAIL}
          errortext="please enter valid email-id"
          onInput={inputHandler}
        />
        <Input
          id="password"
          element="input"
          type="text"
          lebel="Password"
          validator={VALIDATOR_MINLENGTH(6)}
          errortext="please enter at least 6 charactors"
          onInput={inputHandler}
        />
        <Button type="submit" disabled={true}>SIGN IN</Button>
      </form>
    );
};

export default Authenticate;
